import React from 'react';
import './App.css';
import './components/Info';
import {Route, BrowserRouter} from "react-router-dom";

const App = () => {
  return (
      <BrowserRouter>
        <div className="App">
            <a href="/profile"> Profile </a>
            <a href="/dialogs"></a>
            <Route path='/profile' component={Profile}/>
            <Route path='/dialogs' component={Dialogs}/>
        </div>
      </BrowserRouter>
  );
}

export default App;
